window.bookSummaryJSON = "<p><b>We are the daughters of the ones they did not burn...</b></p> <p>When vampire heiress Poppy Villalobos entered my store looking for help, my life became intertwined with the Villalobos mafia in a way I could have never expected.</p> <p>With a killer on the loose and a mysterious man haunting my every move, the Villalobos men insert themselves into my life as my protectors. Now, a demon, angel, werewolf, fae prince, and vampire mafia boss are glued to my side, and it sounds more like a terrible joke than the reality of my life.</p> <p>These sexy-as-sin men may be the face of a mafia family, but the way they look at me leaves me wondering if they truly can be redeemed.</p> <p>Family dinners aren't the only awkward situations I now have to navigate. When my life becomes threatened, a secret kept within the women of my family for generations comes to light, and I am pulled back into a plot that has spanned lifetimes.</p> <p>With enemies around every corner, I have to trust these men with my body and my heart.</p> <p>Witch Blood<i> is a why-choose romance with an HEA and an FMC who doesn't have to settle for one love interest. It is the first book in a series of standalone stories in The Witchblood Legacy.</i></p>"; 
